<?php

require_once dirname(__FILE__).'/../lib/parroquiaGeneratorConfiguration.class.php';
require_once dirname(__FILE__).'/../lib/parroquiaGeneratorHelper.class.php';

/**
 * parroquia actions.
 *
 * @package    voluntarios
 * @subpackage parroquia
 * @author     Your name here
 * @version    SVN: $Id: actions.class.php 23810 2009-11-12 11:07:44Z Kris.Wallsmith $
 */


class parroquiaActions extends autoParroquiaActions
{
  /**
   * Autocompletado Ajax
   */
  public function executeAutocompletar(sfWebRequest $request)
  {
    $this->getResponse()->setContentType('application/json');
    
    $q = $request->getParameter('q');
    $limit = $request->getParameter('limit');
    
    $query = Doctrine_Query::create()
      ->from('Parroquia p')
      ->where('p.nombre LIKE ?', '%'.$q.'%');
    
    $parroquias = $query->fetchArray();
    $nombres_parroquias = array();
    
    foreach ($parroquias as $parroquia) {
      $nombres_parroquias[$parroquia['id']] = $parroquia['nombre'].' ('.$parroquia['municipio'].')';
    }
    return $this->renderText(json_encode($nombres_parroquias));
  }

  /**
   * Exportar datos de parroquias a fichero .csv
   */
  public function executeExportarCsv(sfWebRequest $request)
  {

    $filters = $this->getUser()->getAttribute('parroquia.filters', $this->configuration->getFilterDefaults(), 'admin_module');
    $filters_form = new ParroquiaFormFilter();
    $query = $filters_form->buildQuery($filters);
    $this->parroquias = $query->execute();

    $response = $this->getContext()->getResponse();
    $response->setContentType('application/csv');
    $response->addHttpMeta('cache-control', 'no-cache');
    $response->addHttpMeta('Expires', gmdate("D, d M Y H:i:s") . " GMT",time());
    $response->setHttpHeader('Content-Disposition', 'attachment; filename="Parroquia.csv"');
    $response->setContent($this->getPartial('csv'));
        
    return sfView::NONE;
  }

}


